import React from "react";
import PropTypes from "prop-types";

export const GifGrid = ({ categories }) => {
  console.log(categories,333);
  return (
    <div>
      {categories && <h1>{categories}</h1>}
    </div>
  );
};

GifGrid.propTypes = {
  categories: PropTypes.string,
};
